--Creación tablas 

--Tabla Aeropuertos

CREATE TABLE Aeropuertos(
Id NUMBER(*,0) PRIMARY KEY,
Nombre VARCHAR2(255 BYTE) NOT NULL,
Ciudad VARCHAR2(255 BYTE) NOT NULL,
Abreviatura VARCHAR2(255 BYTE) NOT NULL,
Coordenadas VARCHAR2(255 BYTE) NOT NULL,
Pais VARCHAR2(255 BYTE) NOT NULL,
SECUENCIA_AEROPUERTOS NUMBER(*,0) NOT NULL
)

--Tabla Aviones

CREATE TABLE Aviones(
Id NUMBER(*,0) PRIMARY KEY,
Matricula VARCHAR2(255 BYTE) NOT NULL,
Serial NUMBER(*,0) NOT NULL,
Edad VARCHAR2(255 BYTE)NOT NULL,
Nro_Asientos_Economicos NUMBER(*,0) NOT NULL,
Nro_Asientos_Ejecutivos NUMBER(*,0) NOT NULL,
Estado_Avion VARCHAR2(255 BYTE)NOT NULL,
SECUENCIA_Aviones NUMBER(*,0) NOT NULL
)

--Tabla Empleados

CREATE TABLE Empleados(
Id NUMBER(*,0) PRIMARY KEY,
Nombre_Completo VARCHAR2(255 BYTE) NOT NULL,
Apellidos VARCHAR2(255 BYTE) NOT NULL,
Sexo VARCHAR2(10 BYTE) NOT NULL,
Fecha_Nacimiento DATE  NOT NULL,
Antiguedad NUMBER(*,0) NOT NULL,
Fecha_Entrenamiento DATE  NOT NULL,
Direccion VARCHAR2(255 BYTE) NOT NULL,
Email VARCHAR2(255 BYTE) NOT NULL,
Celular VARCHAR2(255 BYTE) NOT NULL,
Horas_Descanso NUMBER(*,0) NOT NULL,
Estado_Empleado VARCHAR2(255 BYTE) NOT NULL,
Ubicacion_Empleado VARCHAR2(255 BYTE) NOT NULL,
Tipo_Empleado VARCHAR2(255 BYTE) NOT NULL,
SECUENCIA_Empleados NUMBER(*,0) NOT NULL
)

--Tabla Auxiliares

CREATE TABLE Auxiliares(
Id NUMBER(*,0) PRIMARY KEY,
Nombre_Corto_Aux VARCHAR2(255 BYTE) NOT NULL,
SECUENCIA_Auxiliares NUMBER(*,0) NOT NULL,
Id_Empleados CONSTRAINT FK_Auxiliar_Empleado REFERENCES Empleados(ID)
Id_Itinerario CONSTRAINT FK_Auxiliar_Itinerario REFERENCES Itinerarios(ID)
)

--Tabla Pilotos

CREATE TABLE Pilotos(
Id NUMBER(*,0) PRIMARY KEY,
Nombre_Corto_Piloto VARCHAR2(255 BYTE) NOT NULL,
Cargo_Piloto VARCHAR2(255 BYTE) NOT NULL,
Tipo_Licencia VARCHAR2(255 BYTE) NOT NULL,
Nivel_Ingles VARCHAR2(255 BYTE) NOT NULL,
Cantidad_Horas_Vuelo NUMBER(*,0) NOT NULL,
SECUENCIA_Pilotos NUMBER(*,0) NOT NULL,
Id_Empleados CONSTRAINT FK_Piloto_Empleado REFERENCES Empleados(ID)
)

--Tabla Rutas

CREATE TABLE Rutas(
Id NUMBER(*,0) PRIMARY KEY,
Distancia VARCHAR2(255 BYTE) NOT NULL,
Frecuencia NUMBER(*,0) NOT NULL,
Cantidad_Horas NUMBER(*,0) NOT NULL,
Id_Aeropuerto_Origen CONSTRAINT FK_Ruta_Aeropuerto_Origen REFERENCES Aeropuertos(ID),
Id_Aeropuerto_Destino CONSTRAINT FK_Ruta_Aeropuerto_Destino REFERENCES Aeropuertos(ID),
SECUENCIA_Rutas NUMBER(*,0) NOT NULL
)

--Tabla Vuelos Confirmados

--Cambiar las horas a time

CREATE TABLE Vuelos_Confirmados(
Id NUMBER(*,0) PRIMARY KEY,
Nro_TCP NUMBER(*,0) NOT NULL,
Estado_Vuelo VARCHAR2(255 BYTE) NOT NULL,
Id_Ruta CONSTRAINT FK_Vuelo_Ruta REFERENCES Rutas(ID),
SECUENCIA_Vuelos_Confirmados NUMBER(*,0) NOT NULL
)

