--VIEW 1--
CREATE OR REPLACE VIEW ASIGNAR_VUELOS AS
  
SELECT  distinct AEROPUERTO_ORIGEN."ID_VUELO_ORIGEN", AEROPUERTO_ORIGEN.HORA_SALIDA, ITI.ID_VUELOS_CONFIRMADOS AS ID_VUELO_DESTINO, ITI.HORA_ESTIMADA_LLEGADA AS HORA_LLEGADA, 
AV.ID AS ID_AVION_DESTINO, AV.MATRICULA AS MATRICULA_AVION_DESTINO, AEROPUERTO_ORIGEN.NOMBRE_AEROPUERTO_ORIGEN
FROM 					
		(SELECT DISTINCT V.ESTADO_VUELO, V.ID AS ID_VUELO_ORIGEN, AER.NOMBRE AS NOMBRE_AEROPUERTO_ORIGEN,
        AE.CIUDAD AS CIUDAD_AEROPUERTO,R.ID_AEROPUERTO_ORIGEN AS AEROPUERTO_SALIDA, 
        I.HORA_ESTIMADA_SALIDA AS HORA_SALIDA,I.HORA_ESTIMADA_LLEGADA AS HORA_LLEGADA, AE.NOMBRE AS NOMBRE_AEROPUERTO_DESTINO 
						FROM VUELOS_CONFIRMADOS V 
						INNER JOIN RUTAS R ON V.ID_RUTA=R.ID
						INNER JOIN ITINERARIOS I ON I.ID_VUELOS_CONFIRMADOS=V.ID
						--INNER JOIN AVIONES A ON I.ID_AVION=A.ID		
                        INNER JOIN AEROPUERTOS AE ON AE.ID=R.ID_AEROPUERTO_DESTINO
                        INNER JOIN AEROPUERTOS AER ON AER.ID=R.ID_AEROPUERTO_ORIGEN
        WHERE V.ESTADO_VUELO=('Programado') AND I.ID_AVION IS NULL) AEROPUERTO_ORIGEN --En esta parte se valida que se traigan todos los vuelos programados del aeropuerto origen
INNER JOIN RUTAS RU ON RU.ID_AEROPUERTO_DESTINO=AEROPUERTO_ORIGEN.AEROPUERTO_SALIDA
INNER JOIN VUELOS_CONFIRMADOS VU ON VU.ID_RUTA=RU.ID
INNER JOIN ITINERARIOS ITI ON ITI.ID_VUELOS_CONFIRMADOS=VU.ID
INNER JOIN AVIONES AV ON AV.ID=ITI.ID_AVION
WHERE to_date(TO_CHAR(AEROPUERTO_ORIGEN.HORA_SALIDA, 'DD/MM/YYYY'), 'DD/MM/YYYY')=to_date(TO_CHAR(ITI.HORA_ESTIMADA_LLEGADA, 'DD/MM/YYYY'), 'DD/MM/YYYY') --En esta parte se garantiza que la fecha de salida del aeropuerto origen y la fecha de llegada del aeropuerto destino sean iguales
AND 24 * (to_date(to_char(AEROPUERTO_ORIGEN.HORA_SALIDA, 'hh24:mi'), 'hh24:mi') - to_date(to_char(ITI.HORA_ESTIMADA_LLEGADA, 'hh24:mi'), 'hh24:mi'))<=2; --En esta parte se traen los vuelos que estaban 2 horas antes de la hora de salida.

