--VIEW 4--
CREATE OR REPLACE VIEW Personal_Asignado AS
SELECT I.ID AS Id_Itinerario,V.ID AS ID_VUELO,P.NOMBRE_CORTO_PILOTO AS PILOTO, P.ID AS ID_PILOTO, Cop.NOMBRE_CORTO_PILOTO  AS COPILOTO, COP.ID AS ID_COPILOTO, A.NOMBRE_CORTO_AUX AS AUXILIARES, A.ID AS ID_AUXILIARES
FROM AUXILIARES A -- Se unen todas las tablas necesarias para la información de pilotos, copilotos y empleados
                INNER JOIN ITINERARIOS I ON A.ID_ITINERARIO=I.ID
                INNER JOIN VUELOS_CONFIRMADOS V ON I.ID_VUELOS_CONFIRMADOS=V.ID
                INNER JOIN PILOTOS P ON P.ID=I.ID_PILOTO
                INNER JOIN EMPLEADOS EMP ON EMP.ID=P.ID_EMPLEADOS
                INNER JOIN PILOTOS Cop ON Cop.ID=I.ID_COPILOTO
                INNER JOIN EMPLEADOS EMPCOP ON EMPCOP.ID=P.ID_EMPLEADOS
WHERE (V.Estado_Vuelo in ('Confirmado') OR I.HORA_ESTIMADA_LLEGADA BETWEEN (SYSDATE-30) AND SYSDATE); --Se realiza la validación para que solo traiga los vuelos confirmados y los vuelos con vigencia de hace 30 días

SELECT * FROM PERSONAL_ASIGNADO WHERE ID_VUELO IN (7);

--View 5--
CREATE OR REPLACE VIEW Vuelos_Programados AS

SELECT R.ID_AEROPUERTO_ORIGEN, R.ID_AEROPUERTO_DESTINO, VC.ID AS ID_VUELO, VC.ESTADO_VUELO, IT.FECHA FROM VUELOS_CONFIRMADOS VC 
                                   INNER JOIN RUTAS R ON VC.ID_RUTA = R.ID
                                   INNER JOIN ITINERARIOS IT ON IT.ID_VUELOS_CONFIRMADOS = VC.ID
                                   WHERE IT.FECHA BETWEEN SYSDATE AND SYSDATE+14; --Se realiza la validación para que se presenten los aeropuertos origen y destino desde la fecha actual hasta 2 semanas despues, por esto se utiliza el SYSDATE para la fecha del día

SELECT * FROM VUELOS_PROGRAMADOS WHERE ID_AEROPUERTO_ORIGEN=45 AND ID_AEROPUERTO_DESTINO=78; 
    
    
