--Procedure punto 3--
CREATE OR REPLACE PROCEDURE CHECKING_PASAJEROS (Id_Vuelo number, Id_Pasajero number, Tipo_Silla varchar)

AS

ID_CHECK_INS NUMBER;
CONTACTO_EMERG VARCHAR2(255 BYTE);
PAIS_CONTACTO VARCHAR2(255 BYTE);
EMAIL VARCHAR2(255 BYTE);
NRO_CONTACTO VARCHAR2(255 BYTE);
NRO_CONFIRMACION_CHECK_IN VARCHAR2(255 BYTE);
ID_ITINERARIO NUMBER;
NRO_SILLA VARCHAR2(255 BYTE);
Cantidad_Sillas_Totales NUMBER;

BEGIN 

SELECT AV.NRO_ASIENTOS_ECONOMICOS, AV.NRO_ASIENTOS_EJECUTIVOS FROM ITINERARIOS ITI
                          INNER JOIN AVIONES AV ON I.ID_AVION= A.ID
                          INNER JOIN CHECK_INS CHE ON CHE.ID_ITINERARIO=ITI.ID
WHERE I.ID_VUELOS_CONFIRMADOS=Id_Vuelo;

Cantidad_Sillas_Totales:=(AV.NRO_ASIENTOS_ECONOMICOS+AV.NRO_ASIENTOS_EJECUTIVOS);

    IF(ITI.CANTIDAD_PASAJEROS<Cantidad_Sillas_Totales) then
        
        UPDATE ITINERARIOS
        SET ITI.CANTIDAD_PASAJEROS=ITI.CANTIDAD_PASAJEROS +1
        WHERE ITI.ID_VUELOS_CONFIRMADOS=Id_Vuelo;
        
    ELSE 
        DBMS_OUTPUT.put_line ("El avión ya no tiene capacidad");  
    END IF;
 END;   
